import styled from 'styled-components';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Title>
          Jordan Moore
        </Title>
      </header>
    </div>
  );
}

export default App;

const Title = styled.div`
  padding: 1em;
  display: flex;
  color: var(--light2);
  font-size: 500%;

  :hover {
    padding: 5em;
  }
`;
